import React from "react";
import { ProductInterface } from "./Interfaces/ProductInterface";

interface Props {
  product: ProductInterface;
}

const ProductComponent: React.FC<Props> = ({ product }) => {
  const imageUrl = `https://static.my.ge/myauto/photos/${product.photo}/thumbs/${product.car_id}_1.jpg?v=${product.photo_ver}`;

  return (
    <div className="position-relative bg-white rounded rectangle">
      <div className="position-absolute left-0 right-0 top-0 bottom-0">
        <img
          className="position-absolute left-neg-2.25 right-0 top-neg-2.14 bottom-neg-0.71 rounded"
          src={imageUrl}
          alt={product.car_model}
        />
      </div>
      <div className="model w-230 h-17 font-weight-500 fs-14 lh-17 text-black-800">
        {product.car_model}
      </div>
      <div className="year w-44 h-17 font-weight-500 fs-14 lh-17 text-black-500">
        {product.prod_year} წ
      </div>
      <div className="details">
        <p className="id1 w-154 h-13 font-weight-500 fs-12 lh-12 d-flex align-items-end text-black-900">
          motori{product.engine_volume}
        </p>
        <p className="id2 w-154 h-13 font-weight-500 fs-12 lh-12 d-flex align-items-end text-black-900">
          garbeni{product.car_run_km} კმ
        </p>
        <p className="id3 w-154 h-13 font-weight-500 fs-12 lh-12 d-flex align-items-end text-black-900">
          avtomatika{product.gear_type_id} ₾
        </p>
        <p className="id4 w-154 h-13 font-weight-500 fs-12 lh-12 d-flex align-items-end text-black-900">
          ruli{product.right_wheel} $
        </p>
      </div>
      <div className="right-side">
        <div className="ganbajeba w-58 h-13 font-weight-500 fs-11 lh-13 text-error-800">
          {product.checked}
        </div>
        <div className="flagLoc w-95 h-14 font-weight-400 fs-12 lh-14 text-secondary-600">
          {product.location_id}
        </div>
        <p>{product.price} ლარიicon</p>
        <p>icons</p>
        <p>icons</p>
        <p>icons</p>
      </div>
      <div className="bottomLine">
        <p>vip</p>
        <p className="views w-57 h-14 font-weight-400 fs-12 lh-14 text-black-600">
          {product.views} ნახვა
        </p>
      </div>
    </div>
  );
};

export default ProductComponent;
